from django.db import models
from datetime import datetime
from core.models import *

# Create your models here.
class Vendas(models.Model):
    produto = models.ForeignKey(Produto, on_delete=models.CASCADE)
    cliente = models.ForeignKey(Cliente, on_delete=models.CASCADE)
    servico = models.ForeignKey(Servico, on_delete=models.CASCADE)
    valor_total = models.DecimalField(max_digits=5, decimal_places=2)

class Itens_Vendidos(models.Model):
    quantidade_de_venda = models.IntegerField(blank=True, null=True)
    peso_de_venda = models.FloatField(null=True, blank=True)
    venda = models.ForeignKey(Vendas, on_delete=models.CASCADE)


